import logo from "./logo.png";
import "./main.css";
import fire from "./database";
import { BrowserRouter, Route, Switch, Link, Redirect } from "react-router-dom";

export default class Home extends Component {


  render() {
    return (

      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />

          <h1>Easily create an efficient and persuasive CV</h1>
          <p className="button_a">
            CV contructor is a web application that helps you easily create persuasive CVs,
            by choosing one of pur templates and editing it.
          </p>
          <Link className="button_a" to="/SelectTemplate">
            Start the proccess!
          </Link>
        </header>
      </div>
    );
  }
}
